import React, {useState} from 'react';

const App = () =>{

    return(
        <>
        <progress value="10" style={{height:'50px', width:'300px', color:'red'}} max="100"> 10%</progress>
        <br/>
        <input type="text"/>
          </>
    )
}
export default App;
